*:before, *:after {
  box-sizing: inherit;
}

html {
  box-sizing: border-box;
  font-family: Arial, "Helvetica Neue", Helvetica, sans-serif;
  font-weight: normal;
  font-size: 0.8em;
  color: #333;
}

body {
  margin: 0;
}

h1,
h2,
h3,
h4,
h5,
h6 {
  font-weight: normal;
  margin: 0;
  font-size: 1em;
}

i.fa-2x {
  font-size: 1.5em;
}

input[type=radio] {
  vertical-align: middle;
}

button {
  color: #333;
}
button.is-icon {
  border: none;
  background: none;
  font-size: 18px;
  padding: 0 2px;
}
button.is-icon.is-green {
  color: #86ba38;
}
button.is-icon.is-red {
  color: #eb272c;
}
button.is-icon {
  color: #666;
}

.big-button {
  width: 78px;
  height: 70px;
  background: #f0f0f0;
  padding: 8px;
  border-radius: 8px;
  border: 1px solid #afafaf;
  box-shadow: 2px 3px #dcdcdc;
}

.container {
  padding: 5px;
}

.field {
  display: grid;
  grid-template-rows: [field-label] 20px [field-control] 24px;
}
.field label {
  display: block;
  font-weight: bold;
}
.field .input {
  height: 1.5em;
  background-color: #fff;
  border: 1px solid lightgray;
  border-radius: 6px;
  color: #666;
  max-width: 100%;
  width: 100%;
}
.field .input.is-small {
  width: 125px;
}
.field .control {
  box-sizing: border-box;
  clear: both;
  font-size: 1rem;
  position: relative;
  text-align: left;
}
.field .control.has-addons {
  display: flex;
  justify-content: flex-start;
}
.field .control.has-addons > button:first-child {
  padding-left: 5px;
}

.tab-group {
  display: flex;
  flex-wrap: wrap;
  background: #efefef;
  box-shadow: 0 48px 48px -32px rgba(0, 0, 0, 0.3);
}

.tab-item-radio {
  position: absolute;
  opacity: 0;
}

